import React from "react";
import "./css/Contact.css";

const Contact = () => {
    return (
        <section className="contact-section">
            <div className="contact-content">
                <h2>Contact</h2>
                <p>Email: kimtaewoo@example.com</p>
                <p>Phone: +82 10-1234-5678</p>
            </div>
        </section>
    );
};

export default Contact;
